import React from 'react';

function Navigation() {
  return (
    <nav className="Navigation">
    	<h1>Navigation</h1>
    	<ul>
    		<li>HOME</li>
    		<li>PORTFOLIO</li>
    		<li>CONTACT ME</li>
    	</ul>
    </nav>
  );
}

export default Navigation;
